import React, { useState } from 'react'
import Papa from 'papaparse';

const Book = () => {

  const [csvData, setCsvData] = useState([]);

  const handleFileChange = (e) => {
    const file = e.target.files[0];

    Papa.parse(file, {
      complete: (result) => {
        setCsvData(result.data);
      },
      header: true
    })
  }

  handleFileChange()
  console.log(csvData);

  return (
    <div>Book</div>
  )
}

export default Book
